import React from "react";

const styleFormExercise = {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center'
}

const styleLabelExercise = {
    margin: '10px'
}

const styleTextExercise = {
    margin: '10px'
}

const styleButtonAddExercise = {
    backgroundColor: 'green',
    border: 'transparent',
    borderRadius: '10px',
    margin: '5px',
    height: '40px',
    color: 'white'
}

function ExerciseForm(){
    return(
        <form style={styleFormExercise}>
            <label style={styleLabelExercise}>Agregar ejercicio</label>
            <textarea
            style={styleTextExercise} 
            placeholder="Inicia tu rutina"
            />
            <div>
                <button>Cancelar</button>
                <button style={styleButtonAddExercise}>Agregar</button> 
            </div>
        </form>
    )
}
export { ExerciseForm }
